INSERT INTO `dapp_data` (`id`, `name`, `description`, `url`, `stars`, `watch`, `forks`, `commits`, `branches`, `releases`, `contributors`, `created_at`, `pushed_at`, `updated_at`, `owner_name`, `owner_type`, `owner_repo`, `owner_user_star`, `owner_user_follower`, `owner_user_following`, `owner_organ_people`, `language`) VALUES (2008, 'scorelab/EtherBeat', 'With the growing popularity of BitCoin in the last couple of years, other blockchains have been in development for solving various problems that need distributed consensus. Ethereum blockchain is one example, that gives users to develop \'smart contracts\' that runs in the blockchain.  This gives the ability to develop decentralized applications (or dApps). Users do not need to \'trust\' anything or anybody.  In addition to that, dApps are always available and will be guaranteed to be available in the future as well.  Also, it is resistant to traditional attacks such as DDoS.  This framework has given many developers to write a decentralized application without much effort, without needing distributed systems or cryptography knowledge. Many startups are actively developing applications for Ethereum such as Ethereum Name Service (ENS), Etheria or WeiFund.  Unfortunately, because the technology being used is bleeding edge it is inevitable that attacks or hacks will target these apps for monetary reasons.  Last year DAO suffered a severe attack because of its security flaws. Due to that attack, 3.6m ether was stolen from DAO\'s smart contract.  Also, once you publish a smart contract in Ethereum it is not possible to modify or update it as a regular web application. Thus, even developers identify a critical bug in the contract it is not possible to push a bugfix in a straightforward way.  Thus, in order to fill the gap of not having a proper \'smart contract\' compatible monitoring service, we propose to build a web application that can monitor other smart contracts in Ethereum and give the capability to safeguard it\'s critical functions (Ether send and receive) and interact and visualize with smart contract functions in a much simpler way.  Also depending smart contracts can using our base smart contracts to gain the advantage of having \'circuit-breaker\' which will pause the activity if things go wrong in an unexpected way.', 'https://github.com/scorelab/EtherBeat', 1, 'no_watch', 3, 28, 1, 0, -1, '2017-5-6 09:30:00', '2017-11-28 15:44:00', '2017-11-28 17:13:00', 'scorelab', 'Organization', 46, 'no_owner_user_star', 'no_owner_user_follower', 'no_owner_user_following', '9', 'TypeScript');
