CREATE TABLE `dapp_data` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `description` longtext,
  `url` varchar(255) DEFAULT NULL,
  `stars` int(11) DEFAULT NULL,
  `watch` varchar(11) DEFAULT NULL,
  `forks` int(11) DEFAULT NULL,
  `commits` int(11) DEFAULT NULL,
  `branches` int(11) DEFAULT NULL,
  `releases` int(11) DEFAULT NULL,
  `contributors` int(11) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `pushed_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `owner_name` varchar(255) DEFAULT NULL,
  `owner_type` varchar(255) DEFAULT NULL,
  `owner_repo` int(11) DEFAULT NULL,
  `owner_user_star` varchar(255) DEFAULT NULL,
  `owner_user_follower` varchar(255) DEFAULT NULL,
  `owner_user_following` varchar(255) DEFAULT NULL,
  `owner_organ_people` varchar(255) DEFAULT NULL,
  `language` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2333 DEFAULT CHARSET=utf8;


